import Hash from './components/Hash/Hash';
import Block from './components/Block/Block';
import Blockchain from './components/Blockchain/Blockchain';
import Distributed from './components/Distributed/Distributed';
import Tokens from "./components/Tokens/Tokens";
import Coinbase from "./components/Coinbase/Coinbase";
import { TitleField, BodyField } from './components/Fields';
import React from 'react';
import description from './components/Blockchain/description';

const blockChainTitle = description.title;
const blockChainBody = description.body;



class App extends React.Component {

    render() {
        return (
            <div className="App">
                <div className="Hash">
                    <Hash />
                </div>
                <div className="Block">
                    <Block />
                </div>
                <div className="Blockchain">
                    <TitleField titleText={blockChainTitle} />
                    <BodyField bodyText={blockChainBody} />
                    <Blockchain />
                </div>
                <div className="Distributed">
                    <Distributed />
                </div>
                <div className="Tokens">
                    <Tokens />
                </div>
                    <div className="Coinbase">
                <Coinbase />
            </div>

            </div>
        );
    }
}

export default App;
